//       error.life_span = "No se permiten simbolos, solo -"
//    }
//    if (!symbol3.test(input.temperament)) {
//       error.temperament = "No se permiten numeros ni simbolos, solo ,"
//    }

//    return error;
// }

function Form() {
   // const [input, setInput] = useState({
   //    name: "",
   //    weight: "",
   //    height: "",
   //    life_span: "",
   //    temperament: "",
   //    image: "url",
   // })

   // const [error, setError] = useState({
   //    name: "",
   //    weight: "",
   //    height: "",
   //    life_span: "",
   //    temperament: "",
   // })

   const [formData, setFormData] = useState({
      name: '',
      imagen: "",
      minHeight: "",
      maxHeight: "",
      minWeight: "",
      maxWeight: "",
      minLife_span: '',
      maxLife_span: '',
      temperament: [],
   });

   function handleChange(e) {
      // setInput({
      //    ...input,
      //    [e.target.name]: e.target.value,
      // })
      // setError(validate({
      //    ...input,
      //    [e.target.name]: e.target.value,
      // }))

      const { name, value } = e.target;
      setFormData({ ...formData, [name]: value });

   }

   const handleSubmit = async (e) => {
      e.preventDefault()
      
      if (!formData.name || !formData.temperament) {
         alert('Por favor, complete los campos obligatorios.');
         return;
      }

      try {
         // let newDog = {
         //    name: input.name,
         //    image: input.image,
         //    weight: input.weight,
         //    height: input.height,
         //    life_span: input.life_span,
         //    temperament: input.temperament
         // }
         let newDog = {
            name: formData.name,
            imagen: formData.imagen,
            peso: `${formData.minWeight} - ${formData.maxWeight}`,
            altura: `${formData.minHeight} - ${formData.maxHeight}`,
            life_span: `${formData.minLife_span} - ${formData.maxLife_span}`,
            temperament: formData.temperament
         }
         const response = await axios.post('http://localhost:3001/dogs/', newDog)


         window.alert("La raza a sido creada con exito! :D")

      } catch (error) {
         console.error('Error al enviar los datos al servidor:', error);
         window.alert('Hubo un error al crear la raza de perro :C (2)');
      }
   }

   return (
      <div>
         <form onSubmit={handleSubmit}>

               <h1>Pagina de Agregado de Razas</h1>
            <label> Name: 
               <input type='text' placeholder='Nombre de raza' name="name" value={input.value} onChange={handleChange} /> <br />
               {<span>{error.name}</span> && error.name}
            </label>


            <label> Weight: </label>
            <input type='text' placeholder='Aprox Kg (1 - 2)' name="weight" value={input.value} onChange={handleChange} /> <br />
               {<span>{error.weight}</span> && error.weight}


            <label> Height: </label>
               <input type='text' placeholder='Aprox cm (1 - 2)' name="height" value={input.value} onChange={handleChange} /> <br />
               {<span>{error.height}</span> && error.height}


            <label> Life Span: </label>
               <input type='text' placeholder='Aprox años (1 - 2 years)' name="life_span" value={input.value} onChange={handleChange} /> <br />
               {<span>{error.life_span}</span> && error.life_span}


            <label> Temperaments: </label>
               <input type='text' placeholder='Los mas usuales' name="temperament" value={input.value} onChange={handleChange} /> <br />
               {<span>{error.temperament}</span> && error.temperament}


            <label> Image: </label>
            <input type='text' placeholder='URL (no es obligatorio)' name="image" value={input.value} onChange={handleChange} /> <br />
               {<span>{error.image}</span> && error.image}

            <button type="submit">Enviar</button>
            <Link to="/home">
               <button>Home</button>
            </Link>
         </form>
      </div>
   );
}

export default Form;
